import * as React from 'react';
import Card from '@mui/material/Card';
import CardActions from '@mui/material/CardActions';
import CardContent from '@mui/material/CardContent';
import Button from '@mui/material/Button';
import Typography from '@mui/material/Typography';
import { Grid } from '@mui/material';



export const BasicCard = ({match}) => {
    return (
        <Card sx={{ minWidth: 275 }}>
            <CardContent>
                <Grid container justify="center" alignItems="center" spacing={4}>
                    <Grid item>

                        <Typography variant="h5">{match["teams"]["0"]}</Typography>

                    </Grid>
                    <Grid item>

                        <img style={{ width: 85 }} src={require("../img/vs.png")} />
                    </Grid>
                    <Grid item>
                        <Typography variant="h5">{match["teams"]["1"]}</Typography>
                    </Grid>
                </Grid>
            </CardContent>
            <CardActions>

                <Grid container justify="center" >
                    <Button item variant="contained" color="primary">Show Details</Button>
                    <Button item variant="contained" color="primary">{match["date"]}</Button>

                </Grid>

            </CardActions>
        </Card>
    );
}
